import "../styles/about.css";
function About() {
    return (
            <div id="about-wrapper">
                <div className="about">
                    <span className="aboutText">
                        <h1>About Our Hostel</h1>
                        <p>
                        Our hostel is a vibrant and welcoming hostel that caters to travelers from all walks of life. Whether you're a solo adventurer, a group of friends, or a family exploring the city, our hostel is the perfect base for your adventures. With our friendly staff, comfortable accommodations, and range of amenities, you'll feel right at home from the moment you arrive.
                        </p>
                    </span>

                    <span className="welcomeText">
                        <h1>Welcome to PDEU</h1>
                        <p>At PDEU, we offer more than just a place to stay - we provide an experience that will make your visit to PDEU unforgettable. Nestled in the heart of Gandhinagar, our hostel combines comfort, convenience, and affordability to ensure you have an amazing stay.</p>
                    </span>
                </div>
            </div>
    );
}

export default About;
